import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { BrowserRouter as Router, Route, Routes, Link, Navigate } from 'react-router-dom';
import './styles.css';

const App = () => {
  const [clients, setClients] = useState([]);
  const [jobs, setJobs] = useState([]);
  const [crew, setCrew] = useState([]);
  const [equipment, setEquipment] = useState([]);
  const [token, setToken] = useState(localStorage.getItem('token') || '');
  const [userRole, setUserRole] = useState(localStorage.getItem('role') || '');
  const [userEmail, setUserEmail] = useState(localStorage.getItem('email') || 'Guest');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [loggedIn, setLoggedIn] = useState(!!token);
  const [menuOpen, setMenuOpen] = useState(false);

  useEffect(() => {
    if (loggedIn) {
      axios.get('http://localhost:5002/auth/validate', {
        headers: { Authorization: `Bearer ${token}` }
      }).then(() => {
        fetchClients();
        fetchJobs();
        fetchCrew();
        fetchEquipment();
      }).catch(() => {
        localStorage.removeItem('token');
        setLoggedIn(false);
      });
    }
  }, [loggedIn]);

  const fetchClients = async () => {
    if (!token) return;
    try {
      const response = await axios.get('http://localhost:5002/clients', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setClients(response.data);
    } catch (error) {
      console.error('Error fetching clients:', error);
    }
  };

  const fetchJobs = async () => {
    if (!token) return;
    try {
      const response = await axios.get('http://localhost:5002/jobs', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setJobs(response.data);
    } catch (error) {
      console.error('Error fetching jobs:', error);
    }
  };

  const fetchCrew = async () => {
    if (!token) return;
    try {
      const response = await axios.get('http://localhost:5002/crew', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setCrew(response.data);
    } catch (error) {
      console.error('Error fetching crew:', error);
    }
  };

  const fetchEquipment = async () => {
    if (!token) return;
    try {
      const response = await axios.get('http://localhost:5002/equipment', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setEquipment(response.data);
    } catch (error) {
      console.error('Error fetching equipment:', error);
    }
  };

  return (
    <Router>
      <div className="container">
        {!loggedIn ? <Navigate to="/" replace /> : null}
        <header className="header-menu">
          <h1 className="title">Crew Management System</h1>
          {loggedIn && (
            <div className="menu-container">
              <button className="hamburger-menu" onClick={() => setMenuOpen(!menuOpen)}>
                â˜°
              </button>
              {menuOpen && (
                <div className="dropdown-menu">
                  <ul>
                    <li><Link to="/" onClick={() => setMenuOpen(false)}>Home</Link></li>
                    <li><Link to="/clients" onClick={() => setMenuOpen(false)}>Clients</Link></li>
                    <li><Link to="/jobs" onClick={() => setMenuOpen(false)}>Jobs</Link></li>
                    <li><Link to="/crew" onClick={() => setMenuOpen(false)}>Crew</Link></li>
                    <li><Link to="/equipment" onClick={() => setMenuOpen(false)}>Equipment</Link></li>
                    <li className="user-info">Logged in as: {userEmail}</li>
                    <li><button className="btn-logout" onClick={() => setLoggedIn(false)}>Logout</button></li>
                  </ul>
                </div>
              )}
            </div>
          )}
        </header>
        <Routes>
          <Route path="/" element={loggedIn ? (
            <div className="dashboard">
              <h2>Upcoming Jobs</h2>
              <ul className="list">
                {jobs.length > 0 ? (
                  jobs.map(job => (
                    <li key={job.id}>{job.title} - {clients.find(client => client.id === job.client_id)?.name || 'Unknown Client'} - {job.location}</li>
                  ))
                ) : (
                  <p>No upcoming jobs available.</p>
                )}
              </ul>
            </div>
          ) : (
            <div className="auth-box">
              <h2>Login</h2>
              <input type="email" className="input-box" placeholder="Email" value={email} onChange={(e) => setEmail(e.target.value)} />
              <input type="password" className="input-box" placeholder="Password" value={password} onChange={(e) => setPassword(e.target.value)} />
              <button className="btn" onClick={() => setLoggedIn(true)}>Login</button>
            </div>
          )} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
